import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card.js';
// import App from './App';
import * as serviceWorker from './serviceWorker';
import 'tachyons';
//deconstructing robots importing the object into jsx
import { robots } from './robots';
import Buttons from './buttons';

ReactDOM.render(
	<div>
		<Buttons />
		<Card
			id={robots[0].id}
			name={robots[0].name}
			favefood={robots[0].favefood}
			description={robots[0].description}
		/>

		<Card
			id={robots[1].id}
			name={robots[1].name}
			favefood={robots[1].favefood}
			description={robots[1].description}
		/>
		<Card
			id={robots[2].id}
			name={robots[2].name}
			favefood={robots[2].favefood}
			description={robots[2].description}
		/>
		<Card
			id={robots[3].id}
			name={robots[3].name}
			favefood={robots[3].favefood}
			description={robots[3].description}
		/>
	</div>,
	document.getElementById('root')
);
serviceWorker.register();
